import './App.css';
import Axios from 'axios';
import { useState } from "react";

function App() {
  const [query, setQuery] = useState([]);

  const getEmployees = () => {
    console.log("clicked");
    Axios.get("http://localhost:3001/employees").then((response) => {
      const newQuery = response.data;
      setQuery(newQuery);
    })

    updateResult();
  }

  let result = <div></div>

  const updateResult = () => {
    result = query.map((val, key) => {
      <div> {
        Object.keys(val).map((keyName, index) => {
          return (<p>
            {console.log(keyName + " " + val[keyName])}
            {keyName}: {val[keyName]}
          </p>)
        })
      }
      </div>
    })
  }

  return (
    <div className="App">
      <h2>Test</h2>
      {result}
      <h1>Hello world</h1>
      <button onClick={getEmployees}>Get Employee</button>
    </div>
  );
}

export default App;
